import React, { Component } from 'react';

class TodoList extends Component {
    constructor(props) {
        super(props);
        this.state = {
            todos: ["a" , "b" , "c"]
        }
    }   



    render() {
        return (
            <div>
                <h1>Todo List</h1>

                <ul>
                    <li>To do 1</li>
                    <li>To do 2</li>
                </ul>
            </div>
        )
    }
}


export default TodoList;
